import logo from "./logo.svg";
import "./App.css";
import { useRoutes } from "react-router-dom";
import CustomButton from "./components/button";

function App() {
  const routes = useRoutes([
    {
      path: ROUTE.BUTTON,
      element: <CustomButton />,
    },
  ]);
  return routes;
}

export default App;
